const e={title:"Équilibre et Élégance :",subtitle:"BioPilates votre Studio de Pilates à Paris",description:"Découvrez la force dans la fluidité et la grâce dans le mouvement, au cœur de Paris, avec notre approche personnalisée du Pilates.",reserveButton:"Réserver un cours",formationButton:"Réserver une formation"},t={title:"Studio Biopilates Paris,",subtitle:"Votre havre de paix dédié au mieux être",studioDescription:"Premier studio <strong>STOTT Pilates</strong> en France, nous vous offrons une expérience unique pour une transformation physique et mentale profonde. Cours de Pilates pour tous niveaux <strong>Reformer , Reformer et Gyrotonic , Reformer Gyrotonic et Evolis</strong> dispensés par <strong>des instructeurs certifiés</strong>.",benefitsDescription:"Renforcez vos muscles, perdez du poids, développez votre souplesse et atteignez vos objectifs grâce à nos <strong>cours de Pilates personnalisés.</strong> Profitez d'une <strong>séance découverte</strong> et laissez-vous guider sur la voie du bien-être."},s={title:"Nos services",subtitle:"Cours de pilates et gyrotonic pour tous niveaux",description1:"Découvrez une transformation de votre bien-être physique et mental grâce à nos cours de Pilates.",description2:"Chaque mouvement vous guide vers une vitalité et une harmonie intérieure.",ctaButton:"Voir nos tarifs",defaultServices:{reformer:{title:"Cours Reformer",description:"Force et souplesse unies"},reformerGyrotonic:{title:"Cours Reformer & Gyrotonic",description:"Synergie et équilibre"},reformerGyrotonicEvolis:{title:"Cours Reformer, Gyrotonic & Evolis",description:"Trio dynamique pour vitalité"}}},r={title:"Formations professionnelles pour devenir instructeur Pilates",subtitle:"Explorez les bénéfices de sélectionner notre centre pour votre formation en Pilates : Nos programmes de premier ordre sont dirigés par des instructeurs chevronnés qui vous guideront tout au long de votre parcours.",ctaButton:"Voir nos tarifs",types:{reformer:{title:"Reformer",description:"Devenez instructeur <strong>Reformer Pilates</strong> <p>et transformez la posture et la force de vos élèves.</p>",descriptionSmall:"Devenez instructeur <strong>Reformer Pilates</strong> <p>et transformez la posture </p>et la force de vos élèves."},matwork:{title:"Matwork",description:"Devenez instructeur <strong>Matwork Pilates</strong> <p>et maîtrisez l'art du renforcement et de la mobilité.</p>"},chaise:{title:"Chaise",description:"Devenez instructeur de la <strong>Chaise Pilates</strong> et optimisez la force et l'équilibre de vos élèves.",descriptionSmall:"Devenez instructeur de la <strong>Chaise Pilates</strong> et optimisez la force et l'équilibre de vos élèves."},cadillac:{title:"Cadillac",description:"Devenez instructeur <strong>Cadillac Pilates</strong> <p>et explorez de nouvelles dimensions de force et de flexibilité.</p>",descriptionSmall:"Devenez instructeur <strong>Cadillac Pilates</strong> et explorez de<p> nouvelles dimensions de force et de flexibilité.</p>"},barril:{title:"Barril",description:"Devenez instructeur <strong>Barril Pilates</strong> <p>et développez la puissance et la fluidité de vos élèves.</p>",descriptionSmall:"Devenez instructeur <strong>Barril Pilates</strong> et développez<p> la puissance et la fluidité de vos élèves.</p>"},anatomie:{title:"<p>Anatomie Fonctionnelle </p>et biomécanique en privée",description:"Devenez instructeur en <strong>anatomie</strong> <p>et améliorez votre compréhension du corps pour mieux guider vos élèves.</p>",descriptionSmall:"Devenez instructeur en <strong>anatomie</strong> et améliorez votre<p> compréhension du corps pour mieux guider vos élèves.</p>"},blessures:{title:"<p>Blessures et Population spécifiques et prénatal</p> et postnatal-ISP",description:"<p>Devenez instructeur en <strong>ISP</strong> </p>et apprenez à équilibrer corps <p>et esprit pour optimiser la performance.</p>",descriptionSmall:"<p>Devenez instructeur en <strong>ISP</strong> </p>et apprenez à équilibrer corps et esprit optimiser la performance."}}},i={title:"Engagement envers nos clients",benefits:{health:"Amélioration de la condition physique et de la santé.",strength:"Renforcement musculaire et gain de souplesse.",wellness:"Diminution du stress et amélioration du bien être.",skills:"Acquisition de compétences professionnelles."}},o={title:"Témoignages clients",subtitle:"Nos clients formidables",cards:{client1:{user:"Mathilde Paquelier",note:5,title:"Les cours sont variés, ludiques et très efficaces!",review:"J'ai la chance d'aller au studio depuis maintenant plusieurs années... c'est un vrai plaisir de faire du sport dans un tel environnement. Caroline est attentive et les cours sont variés, ludiques et très efficaces!"},client2:{user:"Lyly de la Vallée",note:5,title:"Cette adresse n'en est que plus précieuse.",review:"Un très beau studio à l'ambiance unique à Paris. Caro est une grande pro, incollable sur l'anatomie, à même d'adapter son cours à chacun quelle que soit sa condition pour progresser, récupérer d'une blessure, se remettre en forme, s'entretenir... Les endroits où chaque élève est considéré autrement que comme un numéro sont rares, cette adresse n'en est que plus précieuse."},client3:{user:"Julia",note:5,title:"Excellent Studio de Caroline BERGER.",review:"Excellent Studio de Caroline BERGER ! Caroline est très attentive à nos besoins et nous suit avec beaucoup d'attention. C'est un grand plaisir faire du sport, s'occuper de son corps avec une grande professionnelle, dans un beau studio et le tout accompagné de plein de petit poissons! 😍"}}},n={title:"Découvrez le Pilates chez nous",subtitle:"Profitez d'un offre découverte à un prix raisonnable pour découvrir les bienfaits du Pilates.",reserveButton:"Réserver un cours",contactButton:"Contactez-nous"},l={title:"Blog",subtitle:"Trouvez l'harmonie entre corps et esprit : Bienvenue dans notre rubrique blog.",loading:"Chargement des articles...",notAvailable:"aucun article disponible pour le moment"},a={gymAlt:"Studio Biopilates Paris - Salle de sport",bgReserverAlt:"Background réservation cours Pilates",blogBgAlt:"Background blog"},u={title:"Foire Aux Questions",subtitle:"Vous avez des questions? Nous avons les réponses.",items:[{question:"Quels sont les bienfaits du Pilates Prénatal ?",answer:"Le Pilates prénatal est spécialement conçu pour soutenir le corps en mutation de la future maman. Il cible le transverse abdominal, muscle profond qui agit comme un corset naturel, afin de renforcer le soutien central sans solliciter excessivement les muscles abdominaux. Cette approche douce mais efficace favorise une respiration profonde et une harmonie entre le corps et l’esprit, préparant ainsi physiquement et mentalement les femmes à l’accouchement. En outre, le Pilates prénatal aide à gérer les fluctuations émotionnelles fréquentes durant cette période, renforçant la résilience et le bien-être global."},{question:"Qu’est-ce que le Gyrotonic ?",answer:"Le Gyrotonic est une méthode d’entraînement physique qui s’inspire du Pilates, du yoga, de la danse, du tai-chi et de la natation. Elle se distingue par ses mouvements fluides, circulaires et en spirale, qui étirent et renforcent les muscles tout en améliorant la flexibilité et la mobilité articulaire. Cette pratique se réalise à l’aide d’appareils spécifiques équipés de poulies et de manivelles pour une résistance adaptée, permettant une intégration harmonieuse du corps et de l’esprit. Le Gyrotonic offre ainsi une expérience complète qui favorise un bien-être physique global."},{question:"Quels sont les bienfaits du Pilates Postnatal ?",answer:"Après l’accouchement, le Pilates postnatal offre de nombreux avantages pour les jeunes mamans. Cette méthode douce et adaptée :<ul><li>·       Cible les muscles sollicités pendant la grossesse.</li><li>·       Renforce le plancher pelvien et les muscles abdominaux profonds.</li><li>·       Améliore la circulation sanguine.</li><li>·       Favorise la relaxation et les étirements profonds. En somme, le Pilates postnatal est un allié précieux pour retrouver forme, équilibre et vitalité après la naissance de bébé</li></ul>"},{question:"Qu’est-ce-que la méthode STOTT PILATES ?",answer:"La méthode STOTT PILATES est une approche moderne et complète du Pilates, axée sur la sécurité, l’efficacité et la conscience corporelle.  Elle est bien plus qu’un simple entraînement physique ; c’est une approche holistique qui prend en compte l’anatomie, la respiration et la qualité du mouvement pour un bien-être global."}]},c={hero:e,intro:t,services:s,formations:r,engagement:i,temoignages:o,callToAction:n,blog:l,images:a,faqs:u};export{l as blog,n as callToAction,c as default,i as engagement,u as faqs,r as formations,e as hero,a as images,t as intro,s as services,o as temoignages};
